</div>
<script src="{{ url('js/print/bluebird.min.js') }}"></script>
<script src="{{ url('js/print/jquery-slim.min.js') }}"></script>


<!--IMPORTANT: BE SURE YOU HONOR THIS JS LOAD ORDER-->
<script src="{{ url('js/print/scripts/cptable.js') }}"></script>
<script src="{{ url('js/print/scripts/cputils.js') }}"></script>
<script src="{{ url('js/print/scripts/zip.js') }}"></script>
<script src="{{ url('js/print/scripts/zip-ext.js') }}"></script>
<script src="{{ url('js/print/JSESCPOSBuilder.js') }}"></script>
<script src="{{ url('js/print/scripts/JSPrintManager.js') }}"></script>

<script>
    var clientPrinters = null;
    var _this = this;

    //WebSocket settings
    JSPM.JSPrintManager.auto_reconnect = true;
    JSPM.JSPrintManager.start();
    JSPM.JSPrintManager.WS.onStatusChanged = function () {
        if (jspmWSStatus()) {
            doPrinting();
            //get client installed printers
            // JSPM.JSPrintManager.getPrinters().then(function (printersList) {
            //     clientPrinters = printersList;
            //     var options = '';
            //     for (var i = 0; i < clientPrinters.length; i++) {
            //         options += '<option>' + clientPrinters[i] + '</option>';
            //     }
            //     $('#printerName').html(options);
            //
            // });
        }
    };

    //Check JSPM WebSocket status
    function jspmWSStatus() {
        if (JSPM.JSPrintManager.websocket_status == JSPM.WSStatus.Open)
            return true;
        else if (JSPM.JSPrintManager.websocket_status == JSPM.WSStatus.Closed) {
            console.warn(
                'JSPrintManager (JSPM) is not installed or not running! Download JSPM Client App from https://neodynamic.com/downloads/jspm'
            );
            return false;
        } else if (JSPM.JSPrintManager.websocket_status == JSPM.WSStatus.Blocked) {
            alert('JSPM has blocked this website!');
            return false;
        }
    }

    //Do printing...
    function doPrinting() {
        if (jspmWSStatus()) {

            // Gen sample label featuring logo/image, barcode, QRCode, text, etc by using JSESCPOSBuilder.js

            var escpos = Neodynamic.JSESCPOSBuilder;
            var doc = new escpos.Document();


            // logo image loaded, create ESC/POS commands
            escpos.ESCPOSImage.load('data:image/png;base64,')
                .then(logo => {
                    var escposCommands = doc

                        .font(escpos.FontFamily.B)
                        .align(escpos.TextAlignment.Center)
                        .style([escpos.FontStyle.Bold])
                        .size(1,1)
                        .text("{{ $print['app_name'] }}")
                        .feed()
                        .style([escpos.FontStyle.Normal])
                        .size(0,0)

                        .text("{{ $print['address_1'] }}")
                        .text("{{ $print['address_2'] }}")
                        .feed()

                        .style([escpos.FontStyle.Bold])
                        .text("{{$print['license_no']}}")
                         .feed()

                        .text("{{ $print['invoice_no']  }}")
                        .style([escpos.FontStyle.Normal])

                        .text("{{ $print['reprint']  }}")
                        .style([escpos.FontStyle.Normal])
                        .feed(2)
                        .align()
                        .text("{{$print['patient_name'] }}")
                        .text("{{ $print['father_husband_name'] }}")
                        .text("{{ $print['sale_by'] }}")


                        .text("================================================================")
                        .text("{{ $print['heading'] }}")
                        .text("================================================================")
                        .text("{{ $print['inner'] }}")
                        .text("----------------------------------------------------------------")

                        .text("{{ $print['sub_total'] }}")
                        .text("{{ $print['discount'] }}")
                        .text("{{ $print['gross_total'] }}")
                        .text("{{ $print['refund'] }}")
                        .text("{{ $print['net_total'] }}")
                        .feed()
                        .text("{{ $print['receive_amount'] }}")
                        .text("{{ $print['change_returned'] }}")
                        .text("-----------------------")
                        .text("{{ $print['note'] }}")
                        .text("{{ $print['note1'] }}")
                        .text("{{ $print['note2'] }}")
                        .feed(2)

                        .text("{{ $print['developer']." ".$print['developer_phone'] }}")

                        .feed(2)

                        .cut()
                        .generateUInt8Array();


                    // create ClientPrintJob
                    var cpj = new JSPM.ClientPrintJob();

                    // Set Printer info
                    //     var myPrinter = new JSPM.InstalledPrinter('devzone-printer');
                    // cpj.clientPrinter =myPrinter;// new JSPM.DefaultPrinter();
                    cpj.clientPrinter = new JSPM.InstalledPrinter('devzone-printer');
                    // Set the ESC/POS commands
                    cpj.binaryPrinterCommands = escposCommands;

                    // Send print job to printer!
                    cpj.sendToClient();
                    //close();
                });
        }
    }
</script>

</body>
</html>
